import React from "react";

import "./../App.css";

function Header() {
  return (
    <>
      <br />
      <br />
      <h1>Welcome to the Star Wars information corner!</h1>
      <img
        src="https://static.wikia.nocookie.net/starwars/images/8/80/X-wing_Fathead.png/revision/latest/scale-to-width-down/500?cb=20161004003846"
        alt="Star_Wars_Header_Image"
        height="auto"
        width="auto"
      />
      <h3>Click on a button to learn more about Star Wars.</h3>
      <br />
      <br />
    </>
  );
}

export default Header;
